import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
import './StudentDashboard.css'; 
import { Link } from 'react-router-dom';

function StudentDashboard() {
  const studentId = window.sessionStorage.getItem("studentId");
  return (
    <div className="student-dashboard">


      <main className="student-main">
        <Container>
          <Row>
            <Col md={6} className="mb-4">
              <Card className="student-card shadow">
                <Card.Body className="text-center">
                  <h5 className="card-title">View Result</h5>
                  <Link className="btn btn-primary" to={``}>View Result</Link>

                </Card.Body>
              </Card>
            </Col>
            <Col md={6} className="mb-4">
              <Card className="student-card shadow">
                <Card.Body className="text-center">
                  <h5 className="card-title">View Attendance</h5>
                  <Button variant="success">View Attendance</Button>
                </Card.Body>
              </Card>
            </Col>
          </Row>
        </Container>
      </main>


    </div>
  );
}

export default StudentDashboard;
